#Elimina los espacios que pueda tener un string
def eliminaespacio(string):
    inicio = 0
    final = len(string) - 1
    while inicio <= final and string[inicio] == " ":
        inicio += 1
    while final >= inicio and string[final] == " ":
        final -= 1
    return string[inicio : final + 1]


#Convierte un strring a enteros. Esta funcion se creó puesto que solamente se puede utilizar la función int con un numero de largo 1
