def stringsaenteros(n,d):
    alfabeto = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z']

    entero = 0
    largo= len(n)

    if n in d or n in alfabeto :
      return int(d[n])


    if n.isdigit()==True:
      for i in range(largo):
        entero += int(n[i])*(10 ** (largo- i-1))

      return entero


    if n not in d:

     return f"ERROR:variable indefinida{n}"



#Procesa dos listas L1 y L2, donde L1 corresponde a los numeros de una operación, y L2 corresponde a los operadores.
#Devuelve el resultado de procesarlas
#Ademas devuelve error si los largos de las listas no cumplen con el requisito minimo.
def procerlistas(L1,L2,d):
  N = len(L2)
  Res = stringsaenteros(L1[0],d)

  if len(L1) != len(L2) + 1:


   print("Error al procesar")
   return -1

   # 23-13+hanoi3
   #L1=[23,13,10]
   #L2=[-,+]


  for k in range(N):

    if type(stringsaenteros(L1[k+1],d))==str:
      return stringsaenteros(L1[k+1],d)


    if L2[k] == "+":
        Res+= stringsaenteros(eliminaespacio(L1[k+1]),d)

    elif L2[k]=="-":
      Res-=stringsaenteros(eliminaespacio(L1[k+1]),d)

    elif L2[k]=="*":
      Res*=stringsaenteros(eliminaespacio(L1[k+1]),d)

    elif L2[k]=="/":
      Res//=stringsaenteros(eliminaespacio(L1[k+1]),d)

    elif L2[k]=="^":
      Res**=stringsaenteros(eliminaespacio(L1[k+1]),d)

    else:
      print("ERROR")
      break
  return Res



